#!/bin/sh
if [ -e deltafi ]; then
  echo "'deltafi' directory already exists here!"
  if [[ "" == '--dev' ]]; then
    echo "You might try running deltafi/bootstrap-dev.sh"
  else
    echo "You might try running deltafi/bootstrap.sh"
  end
  exit 1
fi
cat <<ARCHIVE | base64 -d | tar -pzxf -

ARCHIVE
rm -f archive.tar.gz
cd deltafi
if [[ "" == '--dev' ]]; then
  ./bootstrap-dev.sh
else
  ./bootstrap.sh
end
